import React from 'react';

const Experience = () => {
    const experiences = [
        {
            title: 'Software Engineer',
            company: 'Tech Company A',
            duration: 'June 2020 - Present',
            description: 'Developing and maintaining web applications using React and Node.js.'
        },
        {
            title: 'Intern',
            company: 'Tech Company B',
            duration: 'January 2020 - May 2020',
            description: 'Assisted in the development of internal tools and participated in code reviews.'
        },
        {
            title: 'Freelancer',
            company: 'Various Clients',
            duration: '2018 - 2020',
            description: 'Worked on multiple projects including website development and mobile app design.'
        }
    ];

    return (
        <div className="experience">
            <h2>Experience</h2>
            <ul>
                {experiences.map((exp, index) => (
                    <li key={index}>
                        <h3>{exp.title} at {exp.company}</h3>
                        <p>{exp.duration}</p>
                        <p>{exp.description}</p>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default Experience;
